transforms.result:
.va-navbar {
  --va-navbar-mobile-height: 6.5rem;
  --va-navbar-height: 4.0625rem;
  --va-navbar-padding-x: 1rem;
  --va-navbar-padding-y: 1.2rem;
  --va-navbar-transition: transform 0.5s ease;
  --va-navbar-position: relative;
  --va-nav-z-index: calc(var(--va-z-index-teleport-overlay) - 100);
  --va-navbar-sm-padding: 1.1875rem 1rem 1rem;
  --va-navbar-shape-width: 33%;
  --va-navbar-shape-max-width: 467px;
  --va-navbar-shape-bg: rgba(0, 0, 0, 0.5);
  --va-navbar-shape-border-left: 3.1875rem solid transparent;
  --va-navbar-shape-border-right: 3.1875rem solid transparent;
  --va-navbar-shape-transition: border-top-color 0.3s ease;
  --va-navbar-item-margin: 0.75rem;
  --va-navbar-item-margin-side: calc(2 * var(--va-navbar-item-margin));
}
.va-navbar {
  display: grid;
  grid-template: "left center right"/1fr auto 1fr;
  align-items: center;
  transition: var(--va-navbar-transition);
  position: var(--va-navbar-position);
  padding: var(--va-navbar-padding-y) var(--va-navbar-padding-x);
  background-color: var(--va-primary);
  font-family: var(--va-font-family);
  top: 0;
  left: 0;
  width: 100%;
  min-width: 100%;
  z-index: var(--va-navbar-z-index);
}
.va-navbar__left {
  display: flex;
  grid-area: left;
}
.va-navbar__left > .va-navbar__item {
  margin-right: var(--va-navbar-item-margin-side);
}
.va-navbar__left > .va-navbar__item:last-child {
  margin-right: 0;
}
.va-navbar__center {
  display: flex;
  justify-content: center;
  grid-area: center;
}
.va-navbar__center > .va-navbar__item {
  margin: 0 var(--va-navbar-item-margin);
}
.va-navbar__center > .va-navbar__item:last-child {
  margin-right: 0;
}
.va-navbar__center > .va-navbar__item:first-child {
  margin-left: 0;
}
.va-navbar__right {
  display: flex;
  flex-direction: row;
  justify-content: flex-end;
  grid-area: right;
}
.va-navbar__right > .va-navbar__item {
  margin-right: var(--va-navbar-item-margin-side);
}
.va-navbar__right > .va-navbar__item:last-child {
  margin-right: 0;
}
.va-navbar__background-shape {
  transition: var(--va-navbar-shape-transition);
  width: var(--va-navbar-shape-width);
  max-width: var(--va-navbar-shape-max-width);
  position: absolute;
  left: 0;
  right: 0;
  top: 0;
  margin: auto;
  border-top: var(--va-navbar-height) solid var(--va-navbar-shape-bg);
  border-left: var(--va-navbar-shape-border-left);
  border-right: var(--va-navbar-shape-border-right);
  height: 0;
}
@media (max-width: 767.98px) {
.va-navbar__background-shape {
    display: none;
}
}
.va-navbar--shadowed {
  box-shadow: 0 2px 8px var(--va-shadow);
}
.va-navbar--bordered {
  border-bottom: var(--va-background-border);
}
